INSERT INTO `tblpages` (`id`, `PageName`, `PageTitle`, `Description`, `PostingDate`, `UpdationDate`) VALUES
(1, 'aboutme', 'Biographie', '<h1><b>Jean Forteroche</b></h1><p><br></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"forteroche.jpg\" style=\"width: 550px;\"><br></p><p><br></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\">Quod cum ita\r\nsit, paucae domus studiorum seriis cultibus antea celebratae nunc ludibriis\r\nignaviae torpentis exundant, vocali sonu, perflabili tinnitu fidium\r\nresultantes. denique pro philosopho cantor et in locum oratoris doctor artium\r\nludicrarum accitur et bybliothecis sepulcrorum ritu in perpetuum clausis organa\r\nfabricantur hydraulica, et lyrae ad speciem carpentorum ingentes tibiaeque et\r\nhistrionici gestus instrumenta non levia.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\">Et quia\r\nMontius inter dilancinantium manus spiritum efflaturus Epigonum et Eusebium nec\r\nprofessionem nec dignitatem ostendens aliquotiens increpabat, qui sint hi magna\r\nquaerebatur industria, et nequid intepesceret, Epigonus e Lycia philosophus\r\nducitur et Eusebius ab Emissa Pittacas cognomento, concitatus orator, cum\r\nquaestor non hos sed tribunos fabricarum insimulasset promittentes armorum si\r\nnovas res agitari conperissent.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\">Eius populus\r\nab incunabulis primis ad usque pueritiae tempus extremum, quod annis circumcluditur\r\nfere trecentis, circummurana pertulit bella, deinde aetatem ingressus adultam\r\npost multiplices bellorum aerumnas Alpes transcendit et fretum, in iuvenem\r\nerectus et virum ex omni plaga quam orbis ambit inmensus, reportavit laureas et\r\ntriumphos, iamque vergens in senium et nomine solo aliquotiens vincens ad\r\ntranquilliora vitae discessit.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\">Inter has\r\nruinarum varietates a Nisibi quam tuebatur accitus Vrsicinus, cui nos\r\nobsecuturos iunxerat imperiale praeceptum, dispicere litis exitialis certamina cogebatur\r\nabnuens et reclamans, adulatorum oblatrantibus turmis, bellicosus sane milesque\r\nsemper et militum ductor sed forensibus iurgiis longe discretus, qui metu sui\r\ndiscriminis anxius cum accusatores quaesitoresque subditivos sibi consociatos\r\nex isdem foveis cerneret emergentes, quae clam palamve agitabantur, occultis\r\nConstantium litteris edocebat inplorans subsidia, quorum metu tumor notissimus\r\nCaesaris exhalaret.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\"><o:p>&nbsp;</o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-size:14.0pt;line-height:115%\">Constituendi\r\nautem sunt qui sint in amicitia fines et quasi termini diligendi. De quibus tres\r\nvideo sententias ferri, quarum nullam probo, unam, ut eodem modo erga amicum\r\nadfecti simus, quo erga nosmet ipsos, alteram, ut nostra in amicos benevolentia\r\nillorum erga nos benevolentiae pariter aequaliterque respondeat, tertiam, ut,\r\nquanti quisque se ipse facit, tanti fiat ab amicis.<o:p></o:p></span></p><p><br></p><p style=\"color: rgb(94, 87, 55); font-size: 10px; margin: 10px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><br></p>', '2019-05-23 18:01:03', '2019-05-30 09:37:03');
